function buildPatternStyle( patternObject, returnType = 'object' ){
  const bgColor   = useAtomValue( bgColorAtom   );
  const fgColor   = useAtomValue( fgColorAtom   );
  const fgOpacity = useAtomValue( fgOpacityAtom );

  let url = patternObject.url
          . replace(   `fill='%23000000'`, `fill='${fgColor}' fill-opacity='${fgOpacity}'` )
          . replace('#','%23');
  let bgImage = 'url("' + url + '")';

  if( returnType === 'object' ){
    return { backgroundColor: bgColor, backgroundImage: bgImage }
  }
  else if( returnType === 'string' ){
    return `background-color: ${bgColor}; background-image: url("${url}");`;
  }

}  // will be deleted/replaced

// SVG MANIPULATION
function getPatternSvgString( patternObject, attributesObject={} ){

  let svgString = patternObject.svg          || '<svg></svg>';
  let    height = patternObject.height       || '100';
  let     width = patternObject.width        || '100';
  let   fgColor = attributesObject.fgColor   || '#000000';
  let fgOpacity = attributesObject.fgOpacity || '1';
  let    width2 = attributesObject.width     || width;
  let   height2 = width2 / ( width / height );

  // Set --fgColor and --fgOpacity in the (old) SVG-String
  svgString = svgString.replace( "fill='#000000'", `fill='${fgColor}' fill-opacity='${fgOpacity}'` );

  // Convert (old) SVG-String to SVG-DomObject
  let dom = new DOMParser().parseFromString( svgString, 'image/svg+xml' );

  // Add attributes: xmlns + viewbox + height + width
  let svgElement = dom.querySelector('svg');
  svgElement.setAttribute(   'xmlns', 'http://www.w3.org/2000/svg' );
  svgElement.setAttribute( 'viewbox', `0 0 ${width} ${height}`     );
  svgElement.setAttribute(  'height', height2 );
  svgElement.setAttribute(   'width',  width2 );

  // Convert SVG-DomObject to (new) SVG-String
  let srlz = new XMLSerializer();
  let  str = srlz.serializeToString(dom);

  // Return (new) SVG-String
  return str;

}

// SVG ENCODING
function svgStringToEncoded( str ){

  if(str){

    let data = str;
    let externalQuotesValue = 'double'; // 'single'

    // Namespace
    // ----------------------------------------
    if( data.indexOf(`http://www.w3.org/2000/svg`) < 0 ){
      data = data.replace(/<svg/g, `<svg xmlns=${quotes.level2}http://www.w3.org/2000/svg${quotes.level2}`);
    }

    // Encoding
    // ----------------------------------------
    // Use single quotes instead of double to avoid encoding.
    if( externalQuotesValue === 'double' ){
      data = data.replace( /"/g, "'" );
    } else {
      data = data.replace( /'/g, '"' );
    }

    data = data.replace(/>\s{1,}</g, '><');
    data = data.replace(/\s{2,}/g, ' ');

    // Using encodeURIComponent() as replacement function
    // allows to keep result code readable
    const symbols = /[\r\n%#()<>?[\\\]^`{|}]/g;
    data = data.replace(symbols, encodeURIComponent);

    // Return
    return data;
  }

  return '';

}
function encodeToUrlString( str, quotes = "'" ){
  let svg = svgStringToEncoded(str);
  return `data:image/svg+xml,${svg}`;
}
function svgStringToEncodedCSS( str, quotes = "'" ){
  let svg = encodeToUrlString(str);
  return `background-image: url(${quotes}${svg}${quotes});`;
}

